using Dominio.DTOs.Response.ResponseBase;
using System.Net;
using Domain.DTOs.Request.T22;
using iText.Kernel.Pdf;
using iText.Kernel.Events;
using iText.Html2pdf;
using Aplication.Utilities;
using Domain.Models.T22;
using Persistence.Repository.IRepositories.IT22;

namespace Aplication.Services.T22.ResolucionServices
{
    public class ResolucionService : IResolucionService
    {

        private readonly IFormatoPlantillaRepository _formatoPlantillaRepository;

        public ResolucionService(IFormatoPlantillaRepository formatoPlantillaRepository)
        {
            _formatoPlantillaRepository = formatoPlantillaRepository;
        }

        public async Task<ResponseBase<string>> GetResolucion(PdfDTORequest requestPDFDTO)
        {

            try
            {
                //Imagen de encabezado
                Byte[] bytesEncabezado = Convert.FromBase64String("");
                //Imagen de pie de pagina
                Byte[] bytesPieDePagina = Convert.FromBase64String("");


                //Convertir HTML TO PDF y guardarlo en memoria

                MemoryStream stream = new MemoryStream();

                HtmlConverter.ConvertToPdf(requestPDFDTO.html, stream);


                //Crear otras isntaciaas de MemoryStream

                //Para obtener acceso al pdf trasformado del html se almacena el array de bytes en un nuevo MemoryStream

                MemoryStream pdfStream = new MemoryStream(stream.ToArray());

                MemoryStream outputPDF = new MemoryStream();


                //Crea el PdfDocument a partir del MemoryStream de la conversion y mapear su almacenamiento en un nuevo MemoryStream


                PdfDocument pdfDoc = new PdfDocument(new PdfReader(pdfStream), new PdfWriter(outputPDF));

                // Añade el EventHandler

                pdfDoc.AddEventHandler(PdfDocumentEvent.END_PAGE, new MyEvent(bytesEncabezado, bytesPieDePagina));

                // Cierra el PdfDocument
                pdfDoc.Close();

                //Se extrae el array de bystes del pdf resultante del proceso

                byte[] docBytes = outputPDF.ToArray();

                return new ResponseBase<string>(code: HttpStatusCode.OK, message: "Solicitud OK", data: Convert.ToBase64String(docBytes));
            }
            catch (Exception ex)
            {
                var ExcepcionMessage = "";
                Exception innerExcepcion = ex;
                while (innerExcepcion != null)
                {
                    ExcepcionMessage += innerExcepcion.Message;
                    innerExcepcion = innerExcepcion.InnerException;
                }
                return new ResponseBase<string>(code: HttpStatusCode.InternalServerError, message: ExcepcionMessage);
            }
        }

        async Task<ResponseBase<FormatoPlantilla>> IResolucionService.GetFormato(int idFormato)
        {
            var result =  ( await _formatoPlantillaRepository.GetAsync(fp => fp.IdFormato == idFormato));

            if (result is null)
            {
                return new ResponseBase<FormatoPlantilla>(HttpStatusCode.NoContent, "La solicitud respondio OK, pero sin datos", null, 0);
            }

            return new ResponseBase<FormatoPlantilla>(HttpStatusCode.OK, "La solicitud respondio OK", result, 1);
        }
    }
}
